    hexadecimal = ''
    binary_length = len(binary)
    groups = binary_length // 4
    if binary_length % 4 != 0:
        binary = '0' ** (4 - binary_length % 4) + binary
        groups += 1
    for i in range(groups):
        group = binary[i * 4:(i + 1) * 4]
        decimal = 0
        for j in range(4):
            decimal += int(group[j]) * 2 ** (3 - j)
        hexadecimal += hex_dict[decimal]
    return hexadecimal

